import PageContent from '../components/PageContent';

function Home() {
    return (
        <main style={{ marginTop: '60px' }}>
            <PageContent title="Welcome to the Festivals!">
                <p>Please take your seat and fly with us... </p>
            </PageContent>
        </main>
    );

}

export default Home;
